import { useSelector } from 'react-redux'

import BudgetIncome from './BudgetIncome'
import BudgetExpenses from './BudgetExpenses'

function BudgetList() {

    const listData = useSelector((state) => state.list)

    const listIncome = listData.filter((node) => {
        return node.amount > 0
    })

    const listExpenses = listData.filter((node) => {
        return node.amount < 0
    })

    return (
        <div className="container clearfix">
            
            <BudgetIncome listData={listIncome} />
            <BudgetExpenses listDat={listExpenses} />
            
        </div>
    )
}

export default BudgetList
